import React, { Component } from "react";
import GeneralInfo from "./GeneralInfo";
import Title from "./Title";
import Education from "./Education";

class Preview extends Component {
  render() {
    const { firstName, lastName, mail, phone } = this.props.state.generalInfo;
    const { school, city, subject } = this.props.state.education;
    const startEducation = this.props.state.education.from;
    const endEducation = this.props.state.education.to;
    const { edit } = this.props.state;
    return (
        <div>
            <Title />
            <GeneralInfo edit={edit} firstName={firstName} lastName={lastName} mail={mail} phone={phone}/>
            <Education edit={edit} school={school} city={city} subject={subject} from={startEducation} to={endEducation} />
        </div>
    )
  }  
}

export default Preview;
